package safeds.lang

/**
 * The common superclass of all classes.
 */
class Any {

    /**
     * Returns a string representation of the object.
     */
    @Pure
    @PythonCall("str($this)")
    fun toString() -> s: String
}

/**
 * The common subclass of all classes.
 */
class Nothing

/**
 * A truth value.
 */
class Boolean

/**
 * A number.
 */
class Number

/**
 * An integer.
 */
class Int sub Number {
    /**
     * Converts this integer to a floating-point number.
     */
    @Pure
    @PythonCall("float($this)")
    fun toFloat() -> f: Float
}

/**
 * A floating-point number.
 */
class Float sub Number {
    /**
     * Converts this floating-point number to an integer by truncating the fractional part.
     */
    @Pure
    @PythonCall("int($this)")
    fun toInt() -> i: Int
}

/**
 * A list of elements.
 */
class List<out E> {

    /**
     * Returns the number of elements in the list.
     */
    @Pure
    @PythonCall("len($this)")
    fun size() -> size: Int
}

/**
 * A map of keys to values.
 */
class Map<K, out V> {

    /**
     * Returns the number of entries in the map.
     */
    @Pure
    @PythonCall("len($this)")
    fun size() -> size: Int

    /**
     * Returns the keys of the map.
     */
    @Pure
    @PythonCall("list($this.keys())")
    fun keys() -> keys: List<K>

    /**
     * Returns the values of the map.
     */
    @Pure
    @PythonCall("list($this.values())")
    fun values() -> values: List<V>
}

/**
 * Some text.
 */
class String {

    /**
     * Parses the string to a floating-point number.
     */
    @Pure
    @PythonCall("float($this)")
    fun toFloat() -> f: Float

    /**
     * Parses the string to an integer.
     *
     * @param base The base of the integer.
     */
    @Pure
    @PythonCall("int($this, $base)")
    fun toInt(base: Int = 10) -> i: Int
}

package safeds.data.image.containers

/**
 * A container for image data.
 */
class Image {
    /**
     * Get the width of the image in pixels.
     */
    attr width: Int
    /**
     * Get the height of the image in pixels.
     */
    attr height: Int
    /**
     * Get the number of channels of the image.
     */
    attr channel: Int

    /**
     * Create an image from a file.
     *
     * @param path The path to the image file.
     * @param device The device where the tensor will be saved on. Defaults to the default device
     *
     * @result result1 The image.
     */
    @Impure([ImpurityReason.FileReadFromParameterizedPath("path")])
    @PythonName("from_file")
    static fun fromFile(
        path: String
    ) -> result1: Image

    /**
     * Save the image as a JPEG file.
     *
     * @param path The path to the JPEG file.
     */
    @Impure([ImpurityReason.FileWriteToParameterizedPath("path")])
    @PythonName("to_jpeg_file")
    fun toJpegFile(
        path: String
    )

    /**
     * Save the image as a PNG file.
     *
     * @param path The path to the PNG file.
     */
    @Impure([ImpurityReason.FileWriteToParameterizedPath("path")])
    @PythonName("to_png_file")
    fun toPngFile(
        path: String
    )

    /**
     * Return a new `Image` that has been resized to a given size.
     *
     * The original image is not modified.
     *
     * @param newWidth The new width of the image.
     * @param newHeight The new height of the image.
     *
     * @result result1 The image with the given width and height.
     */
    @Pure
    fun resize(
        @PythonName("new_width") const newWidth: Int,
        @PythonName("new_height") const newHeight: Int
    ) -> result1: Image where {
        newWidth >= 0,
        newHeight >= 0
    }

    /**
     * Return a new `Image` that is converted to grayscale.
     *
     * The original image is not modified.
     *
     * @result result1 The grayscale image.
     */
    @Pure
    @PythonName("convert_to_grayscale")
    fun convertToGrayscale() -> result1: Image

    /**
     * Return a new `Image` that has been cropped to a given bounding rectangle.
     *
     * The original image is not modified.
     *
     * @param x The x coordinate of the top-left corner of the bounding rectangle.
     * @param y The y coordinate of the top-left corner of the bounding rectangle.
     * @param width The width of the bounding rectangle.
     * @param height The height of the bounding rectangle.
     *
     * @result result1 The cropped image.
     */
    @Pure
    fun crop(
        const x: Int,
        const y: Int,
        const width: Int,
        const height: Int
    ) -> result1: Image where {
        x >= 0,
        y >= 0,
        width >= 0,
        height >= 0
    }

    /**
     * Return a new `Image` that is flipped vertically (horizontal axis, flips up-down and vice versa).
     *
     * The original image is not modified.
     *
     * @result result1 The flipped image.
     */
    @Pure
    @PythonName("flip_vertically")
    fun flipVertically() -> result1: Image

    /**
     * Return a new `Image` that is flipped horizontally (vertical axis, flips left-right and vice versa).
     *
     * The original image is not modified.
     *
     * @result result1 The flipped image.
     */
    @Pure
    @PythonName("flip_horizontally")
    fun flipHorizontally() -> result1: Image

    /**
     * Return a new `Image` with an adjusted brightness.
     *
     * The original image is not modified.
     *
     * @param factor The brightness factor.
     * 1.0 will not change the brightness.
     * Below 1.0 will result in a darker image.
     * Above 1.0 will resolut in a brighter image.
     * Has to be bigger than or equal to 0 (black).
     *
     * @result result1 The Image with adjusted brightness.
     */
    @Pure
    @PythonName("adjust_brightness")
    fun adjustBrightness(
        const factor: Float
    ) -> result1: Image where {
        factor >= 0.0
    }

    /**
     * Return a new `Image` with noise added to the image.
     *
     * The original image is not modified.
     *
     * @param standardDeviation The standard deviation of the normal distribution. Has to be bigger than or equal to 0.
     *
     * @result result1 The image with added noise.
     */
    @Pure
    @PythonName("add_noise")
    fun addNoise(
        @PythonName("standard_deviation") const standardDeviation: Float
    ) -> result1: Image where {
        standardDeviation >= 0.0
    }

    /**
     * Return a new `Image` with adjusted contrast.
     *
     * The original image is not modified.
     *
     * @param factor If factor > 1, increase contrast of image.
     * If factor = 1, no changes will be made.
     * If factor < 1, make image greyer.
     * Has to be bigger than or equal to 0 (gray).
     *
     * @result result1 New image with adjusted contrast.
     */
    @Pure
    @PythonName("adjust_contrast")
    fun adjustContrast(
        const factor: Float
    ) -> result1: Image where {
        factor >= 0.0
    }

    /**
     * Return a new `Image` with adjusted color balance.
     *
     * The original image is not modified.
     *
     * @param factor Has to be bigger than or equal to 0.
     * If 0 <= factor < 1, make image greyer.
     * If factor = 1, no changes will be made.
     * If factor > 1, increase color balance of image.
     *
     * @result result1 The new, adjusted image.
     */
    @Pure
    @PythonName("adjust_color_balance")
    fun adjustColorBalance(
        const factor: Float
    ) -> result1: Image where {
        factor >= 0.0
    }

    /**
     * Return a blurred version of the image.
     *
     * The original image is not modified.
     *
     * @param radius Radius is directly proportional to the blur value. The radius is equal to the amount of pixels united in
     * each direction. A radius of 1 will result in a united box of 9 pixels.
     *
     * @result result1 The blurred image.
     */
    @Pure
    fun blur(
        const radius: Int
    ) -> result1: Image where {
        radius >= 0
    }

    /**
     * Return a sharpened version of the image.
     *
     * The original image is not modified.
     *
     * @param factor If factor > 1, increase the sharpness of the image.
     * If factor = 1, no changes will be made.
     * If factor < 1, blur the image.
     * Has to be bigger than or equal to 0 (blurred).
     *
     * @result result1 The image sharpened by the given factor.
     */
    @Pure
    fun sharpen(
        const factor: Float
    ) -> result1: Image where {
        factor >= 0.0
    }

    /**
     * Return a new `Image` with colors inverted.
     *
     * The original image is not modified.
     *
     * @result result1 The image with inverted colors.
     */
    @Pure
    @PythonName("invert_colors")
    fun invertColors() -> result1: Image

    /**
     * Return a new `Image` that is rotated 90 degrees clockwise.
     *
     * The original image is not modified.
     *
     * @result result1 The image rotated 90 degrees clockwise.
     */
    @Pure
    @PythonName("rotate_right")
    fun rotateRight() -> result1: Image

    /**
     * Return a new `Image` that is rotated 90 degrees counter-clockwise.
     *
     * The original image is not modified.
     *
     * @result result1 The image rotated 90 degrees counter-clockwise.
     */
    @Pure
    @PythonName("rotate_left")
    fun rotateLeft() -> result1: Image

    /**
     * Return a grayscale version of the image with the edges highlighted.
     *
     * The original image is not modified.
     *
     * @result result1 The image with edges found.
     */
    @Pure
    @PythonName("find_edges")
    fun findEdges() -> result1: Image
}

package safeds.data.tabular.containers

from safeds.data.image.containers import Image
from safeds.data.tabular.typing import ColumnType

/**
 * A column is a named collection of values.
 *
 * @param name The name of the column.
 * @param data The data.
 *
 * @example
 * pipeline example {
 *     val column = Column("test", [1, 2, 3]);
 * }
 */
class Column<out T = Any?>(
    name: String,
    data: List<T> = []
) {
    /**
     * Return the name of the column.
     */
    attr name: String
    /**
     * Return the number of elements in the column.
     */
    @PythonName("number_of_rows") attr numberOfRows: Int
    /**
     * Return the type of the column.
     */
    attr type: ColumnType

    /**
     * Return a list of all unique values in the column.
     *
     * @result result1 List of unique values in the column.
     */
    @Pure
    @PythonName("get_unique_values")
    fun getUniqueValues() -> result1: List<T>

    /**
     * Return column value at specified index, starting at 0.
     *
     * @param index Index of requested element.
     *
     * @result result1 Value at index in column.
     */
    @Pure
    @PythonName("get_value")
    fun getValue(
        index: Int
    ) -> result1: T

    /**
     * Check if all values have a given property.
     *
     * @param predicate Callable that is used to find matches.
     *
     * @result result1 True if all match.
     */
    @Pure
    fun all(
        predicate: (param1: T) -> param2: Boolean
    ) -> result1: Boolean

    /**
     * Check if any value has a given property.
     *
     * @param predicate Callable that is used to find matches.
     *
     * @result result1 True if any match.
     */
    @Pure
    fun any(
        predicate: (param1: T) -> param2: Boolean
    ) -> result1: Boolean

    /**
     * Check if no values has a given property.
     *
     * @param predicate Callable that is used to find matches.
     *
     * @result result1 True if none match.
     */
    @Pure
    fun none(
        predicate: (param1: T) -> param2: Boolean
    ) -> result1: Boolean

    /**
     * Return whether the column has missing values.
     *
     * @result result1 True if missing values exist.
     */
    @Pure
    @PythonName("has_missing_values")
    fun hasMissingValues() -> result1: Boolean

    /**
     * Return a new column with a new name.
     *
     * The original column is not modified.
     *
     * @param newName The new name of the column.
     *
     * @result result1 A new column with the new name.
     */
    @Pure
    fun rename(
        @PythonName("new_name") newName: String
    ) -> result1: Column

    /**
     * Apply a transform method to every data point.
     *
     * The original column is not modified.
     *
     * @param transformer Function that will be applied to all data points.
     *
     * @result result1 The transformed column.
     */
    @Pure
    fun transform<R>(
        transformer: (param1: T) -> param2: R
    ) -> result1: Column<R>

    /**
     * Calculate Pearson correlation between this and another column. Both columns have to be numerical.
     *
     * @result result1 Correlation between the two columns.
     */
    @Pure
    @PythonName("correlation_with")
    fun correlationWith(
        @PythonName("other_column") otherColumn: Column
    ) -> result1: Float

    /**
     * Calculate the idness of this column.
     *
     * We define the idness as follows:
     *
     * $$
     * \frac{\text{number of different values}}{\text{number of rows}}
     * $$
     *
     * @result result1 The idness of the column.
     */
    @Pure
    fun idness() -> result1: Float

    /**
     * Return the maximum value of the column. The column has to be numerical.
     *
     * @result result1 The maximum value.
     */
    @Pure
    fun maximum() -> result1: Float

    /**
     * Return the mean value of the column. The column has to be numerical.
     *
     * @result result1 The mean value.
     */
    @Pure
    fun mean() -> result1: Float

    /**
     * Return the median value of the column. The column has to be numerical.
     *
     * @result result1 The median value.
     */
    @Pure
    fun median() -> result1: Float

    /**
     * Return the minimum value of the column. The column has to be numerical.
     *
     * @result result1 The minimum value.
     */
    @Pure
    fun minimum() -> result1: Float

    /**
     * Return the ratio of missing values to the total number of elements in the column.
